import axios from 'axios';

const URL  = 'https://api.aftership.com/v4';
const API_KEY = 'f16df899-38ce-4534-826b-cbffecd42871';

export const fetchData = async (query) => {
    const data  = await axios.get(URL, {
        params:{
            q: query,
            APPID: API_KEY,
        }
    });
    return data;
}
